import React from "react";

import "./Card.css";

const Card = props => {
    return (
        <div className={`card ${props.className}`}>
            <div className="card-header"></div>
            <div className="card-body"></div>
            <div className="card-footer"></div>
        </div>
    );
}

export default Card;
